import MenuBar from '../components/menu-bar'
import './account.css'

export default function AccountPage() {
  return (
    <div>
      <MenuBar index={4} />
      <div id='Account'>
        <img id='Account-photo' alt='头像' />
        <div id='Account-username'>用户名</div>
      </div>
    </div>
  )
}
